import React, { useState } from "react";
import {
  Button,
  Grid,
  Alert,
  List,
  ListItem,
  ListItemText,
  Typography,
} from "@mui/material";
import FileUploadOutlinedIcon from "@mui/icons-material/FileUploadOutlined";

import "./userDash.css";
import NavBar from "./components/Navbar";

const [error, setError] = useState();

function handleLogout(currentUser) {}

export default function UserDash() {
  return (
    <>
      {" "}
      <NavBar />
      {error && <Alert severity="error"> {error} </Alert>}
      <Grid
        container
        sx={{
          padding: "10em 7em 4em",
        }}
      >
        <Grid
          item
          width={"50%"}
          sx={{
            padding: "2em",
          }}
        >
          <div className="user_widget">
            <div className="upload_icon">
              <FileUploadOutlinedIcon
                fontSize="large"
                sx={{
                  fontSize: "4em",
                }}
              />
            </div>
          </div>
        </Grid>
        <Grid
          item
          width={"50%"}
          sx={{
            padding: "2em",
          }}
        >
          <Typography
            variant="h3"
            sx={{
              color: "#ffffff",
              display: "flex",
              border: "1px solid pink",
              padding: "1em",
              justifyContent: "center",
            }}
          >
            Upload a picture of a crop to get more info
          </Typography>

          <div className="predict_btn">
            <Button
              variant="contained"
              size="large"
              sx={{
                color: "#ffffff",
                background: "#308335",
                padding: "1em",
              }}
            >
              CHECK
            </Button>
          </div>
        </Grid>
        <Button variant="outlined" onClick={handleLogout}>
          {" "}
          LogOut{" "}
        </Button>
      </Grid>
    </>
  );
}
